INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("ペコリーヌとの出会い", 91002, 7, 40, 5118061, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "青空の下で謁見", 2, 2834, 0, 8, 0, 10118, "フリーマーケット会場", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("マホとの出会い", 91002, 7, 40, 5118062, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "未来の騎空団\nマスコット？", 2, 2835, 0, 8, 0, 10118, "フリーマーケット会場", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("アキノとの出会い", 91002, 7, 40, 5118063, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "お嬢さまからの\n緊急依頼", 2, 2837, 0, 8, 0, 10118, "ランドソル市街地", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("ジュンとの出会い", 91002, 18, 40, 5118064, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "黄金色の悩みごと", 2, 4108402, 0, 8, 0, 10118, "フリーマーケット会場", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("カオリとの出会い", 91002, 18, 40, 5118065, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "白熱！　格闘大会！", 2, 4107402, 0, 8, 0, 10118, "フリーマーケット会場", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("ニノンとの出会い", 91002, 16, 40, 5118066, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "祭り太鼓はオーエドの華", 2, 9000227, 1, 8, 0, 10118, "オーエド町", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("スズナとの出会い", 91002, 19, 40, 5118067, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "人気者は遅れて\nやってくる", 3, 2101181, 0, 8, 0, 10118, "フリーマーケット会場", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("ナナカとの出会い", 91002, 18, 40, 5118068, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "巫女・ミーツ・魔法少女", 3, 4109402, 0, 8, 0, 10118, "ランドソル市街地", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("キャル＆コッコロとの出会い", 91002, 18, 40, 5118069, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "ネズ耳は二度なくなる", 3, 4305402, 0, 8, 0, 10118, "フリーマーケット会場", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("ユカリとの出会い", 91002, 18, 40, 5118070, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "この出会いにカンパイ！", 3, 4101402, 0, 8, 0, 10118, "ランドソル市街地", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("アオイとの出会い", 91002, 18, 40, 5118071, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "陰陽アンサンブル", 3, 4106402, 0, 8, 0, 10118, "ランドソル市街地", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("シノブとの出会い", 91002, 7, 40, 5118072, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "運試し十番勝負！", 3, 2836, 1, 8, 0, 10118, "フリーマーケット会場", 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("オープニング", 0, 0, 0, 5118600, 0, "彼女たちの新たな日常", 1, 0, 0, 0, 10145115, 10118, 0, 0);
